// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PropertieMarketplace {
    enum State { Active, Deactivated }

    struct Propertie {
        uint256 id;
        string name;
        string location;
        uint256 price;
        bytes32 proof;
        address owner;
        State state;
        string sellerInfo;
    }

    mapping(bytes32 => Propertie) public properties;
    uint256 public nextPropertieId;

    event PropertieCreated(
        uint256 id,
        string name,
        string location,
        uint256 price,
        bytes32 proof,
        address owner,
        State state,
        string sellerInfo
    );

    function createPropertie(
        string memory name,
        string memory location,
        uint256 price,
        bytes32 proof,
        string memory sellerInfo
    ) public {
        bytes32 propertieHash = keccak256(abi.encodePacked(name, location, proof));
        require(properties[propertieHash].owner == address(0), "Propertie already exists");

        properties[propertieHash] = Propertie({
            id: nextPropertieId,
            name: name,
            location: location,
            price: price,
            proof: proof,
            owner: msg.sender,
            state: State.Deactivated,
            sellerInfo: sellerInfo
        });

        emit PropertieCreated(nextPropertieId, name, location, price, proof, msg.sender, State.Deactivated, sellerInfo);
        nextPropertieId++;
    }
}
